public TimelineHealth getHealthStatus() {
  try {
    fs.exists(rootPath);
  } catch (IOException e) {
    return new TimelineHealth(
        TimelineHealth.TimelineHealthStatus.READER_CONNECTION_FAILURE,
        e.getMessage()
        );
  }
  return new TimelineHealth(TimelineHealth.TimelineHealthStatus.RUNNING,
      "");
}
